/**
 *
 * Footer.js
 * @author Peter Laxalt
 * @description The website footer.
 *
 */

// Core
import React from "react";
import Link from "next/link";

// Begin Component
//////////////////////////////////////////////////////////////////////

export const Navigation = () => (
  <nav>
    <Link href="/">
      <a>Home</a>
    </Link>{" "}
    |
    <Link href="/about">
      <a>About</a>
    </Link>{" "}
    |
    <Link href="/contact">
      <a>Contact</a>
    </Link>
  </nav>
);

// End Component
